import React, { Component } from "react";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { bio } from './robot';


class App extends Component {
    constructor() {
        super();
        this.state = {
            bio: bio,
            searchField: ''
        }
    }
    render() {
        return (
            <div className='tc'>
                <h1>RoboFriend </h1>
                <SearchBox />
                <CardList  bio={bio}/>
            </div>
        );
    }
}

 export default App;
